import React, { Component } from 'react'
import './SelectBox.scss';

export default class SelectBox extends Component {
    render() {
        return (
            <div className="input-box-container">
                <select className="select-box">
                    <option>
                        1
                    </option>
                </select>
            </div>
        )
    }
}
